// https://emojibase.dev version 15.3.0

const b4a = require('b4a')

const INDEX = b4a.from('', 'base64')

exports.POINTS = to32(0, 12036)
exports.KEY_TO_POINTS = to16(12036, 27468)
exports.POINTS_TO_KEY = to16(27468, 31334)
exports.KEYS = INDEX.subarray(31334, 57524)

function to16 (offset, end) {
  return new Uint16Array(INDEX.buffer, offset, (end - offset) / 2)
}

function to32 (offset, end) {
  return new Uint32Array(INDEX.buffer, offset, (end - offset) / 4)
}
